"California","illegal immigration","Steve King","immigrant labor"],"channelId":"UCn4sPeUomNGIr26bElVdDYg","isOwnerViewing":false,"shortDescription":"Rep. Devin Nunes went from suing a cow parody Twitter account to being center stage in the impeachment process. Heres how the child of Portuguese immigrant farmers became a Republican heavy.\n Subscribe to NowThis: http://go.nowth.is/News_Subscribe\n Sign up for our newsletter KnowThis to get the biggest stories of the day delivered straight to your inbox: https://go.nowth.is/KnowThis\n\nIn US news and current events today, long before Devin Nunes was allegedly taking trips to Europe and milking Ukrainians for dirt on the Bidens, he was probably milking cows on his familys dairy farm.\n\nThis is the story of Devin Nunes a congressman who went from suing a cow parody Twitter account to being center stage in one former steak salesman's impeachment process.\n\nDevin Gerald Nunes was born in 1973 in Tulare, California. His family is of Portugese descent, they emigrated from Azores to the U.S., which is possibly why Nunes once had a lax view on immigration. Nunes once supported moderate immigration reform such as giving amnesty to undocumented people living and working in the U.S.. \n\nBut as Trump has increased resources for Immigration and Customs Enforcement and instituted a family separation policy at the border, Nunes has stood by the recipient of Home Alone 2 residual checks.\n\nBefore Nunes backed Trumps every move, he was working on his familys 640-acre dairy farm, looking like this. Nunes grew up on the California dairy farm, seemingly milking cows and raising cattle. But along the way, he also raised some eyebrows.\n\nA deeply sourced Esquire report notes that the farm secretly moved to Sibley, Iowa more than a decade ago. Nunes hasnt acknowledged the move and the piece alleges that the farm heavily relies on cheap undocumented immigrant labor.\n\n Its worth noting that in 2010, Nunes campaigned for racist Iowa Congressman Steve King, who called illegal immigration a slow-motion terrorist attack. Nunes might want to stop campaigning for guys that want to rid the country of the very people his familys farm ostensibly relies on to stay afloat. Nunes has since sued Ryan Lizza, the author of the Esquire piece, and the publisher, for $75 million in damages.\n\n#WhoIs #DevinNunes #Republican #News #NowThis #NowThisNews\n\nConnect with NowThis\n Like us on Facebook: http://go.nowth.is/News_Facebook\n Tweet us on Twitter: http://go.nowth.is/News_Twitter\n Follow us on Instagram: http://go.nowth.is/News_Instagram\n Find us on Snapchat Discover: http://go.nowth.is/News_Snapchat\n\nNowThis is your premier news outlet providing you with all the videos you need to stay up to date on all the latest in trending news. From entertainment to politics, to viral videos and breaking news stories, were delivering all you need to know straight to your social feeds. We live where you live.\n\nhttp://www.youtube.com/nowthisnews\n@nowthisnews","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/Uqt4Sls_yTI/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBRizVTrxUQe6bo2gZtzOE_zkU1TQ","width":168,"height":94},{"url":"https://i.ytimg.com/vi/Uqt4Sls_yTI/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDy-etd0aKboGJ_DEsiUilDVa_89Q","width":196,"height":110},{"url":"https://i.ytimg.com/vi/Uqt4Sls_yTI/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLBgPkT0zDyyqjRmhbtBtWEcMYzsmw","width":246,"height":138},{"url":"https://i.ytimg.com/vi/Uqt4Sls_yTI/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLD20r5mCn79H4oInWOPCYU66m9W9g","width":336,"height":188},{"url":"https://i.ytimg.com/vi/Uqt4Sls_yTI/maxresdefault.jpg","width":1920,"height":1080}]},"allowRatings":true,"viewCount":"164393","author":"NowThis News","isPrivate":false,"isU ented people living and working in the U.S.. \n\nBut as Trump has increased resources for Immigration and Customs Enforcement and instituted a family separation policy at the border, Nunes has stood by the recipient of Home Alone 2 residual checks.\n\nBefore Nunes backed Trumps every move, he was working on his familys 640-acre dairy farm, looking like this. Nunes grew up on the California dairy farm, seemingly milking cows and raising cattle. But along the way, he also raised some eyebrows.\n\nA deeply sourced Esquire report notes that the farm secretly moved to Sibley, Iowa more than a decade ago. Nunes hasnt acknowledged the move and the piece alleges that the farm heavily relies on cheap undocumented immigrant labor.\n\n Its worth noting that in 2010, Nunes campaigned for racist Iowa Congressman Steve King, who called illegal immigration a slow-motion terrorist attack. Nunes might want to stop campaigning for guys that want to rid the country of the very people his familys farm ostensibly relies on to stay afloat. Nunes has since sued Ryan Lizza, the author of the Esquire piece, and the publisher, for $75 million in damages.\n\n#WhoIs #DevinNunes #Republican #News #NowThis #NowThisNews\n\nConnect with NowThis\n Like us on Facebook: http://go.nowth.is/News_Facebook\n Tweet us on Twitter: http://go.nowth.is/News_Twitter\n Follow us on Instagram: http://go.nowth.is/News_Instagram\n Find us on Snapchat Discover: http://go.nowth.is/News_Snapchat\n\nNowThis is your premier news outlet providing you with all the videos you need to stay up to date on all the latest in trending news. From entertainment to politics, to viral videos and breaking news stories, were delivering all you need to know straight to your social feeds. We live where you live.\n\nhttp://www.youtube.com/nowthisnews\n@nowthisnews"},"lengthSeconds":"498","ownerProfileUrl":"http://www.youtube.com/user/nowthismedia","externalChannelId":"UCn4sPeUomNGIr26bElVdDYg","isFamilySafe":true,"availableCountries":[" A%2F%2Fgo.nowth.is%2FKnowThis","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nIn US news and current events today, long before Devin Nunes was allegedly taking trips to Europe and milking Ukrainians for dirt on the Bidens, he was probably milking cows on his familys dairy farm.\n\nThis is the story of Devin Nunes a congressman who went from suing a cow parody Twitter account to being center stage in one former steak salesman's impeachment process.\n\nDevin Gerald Nunes was born in 1973 in Tulare, California. His family is of Portugese descent, they emigrated from Azores to the U.S., which is possibly why Nunes once had a lax view on immigration. Nunes once supported moderate immigration reform such as giving amnesty to undocumented people living and working in the U.S.. \n\nBut as Trump has increased resources for Immigration and Customs Enforcement and instituted a family separation policy at the border, Nunes has stood by the recipient of Home Alone 2 residual checks.\n\nBefore Nunes backed Trumps every move, he was working on his familys 640-acre dairy farm, looking like this. Nunes grew up on the California dairy farm, seemingly milking cows and raising cattle. But along the way, he also raised some eyebrows.\n\nA deeply sourced Esquire report notes that the farm secretly moved to Sibley, Iowa more than a decade ago. Nunes hasnt acknowledged the move and the piece alleges that the farm heavily relies on cheap undocumented immigrant labor.\n\n Its worth noting that in 2010, Nunes campaigned for racist Iowa Congressman Steve King, who called illegal immigration a slow-motion terrorist attack. Nunes might want to stop campaigning for guys that want to rid the country of the very people his familys farm ostensibly relies on to stay afloat. Nunes has since sued Ryan Lizza, the author of the Esquire piece, and the publisher, for $75 million in damages.\n\n"},{"text":"#WhoIs","navigationEndpoint":{"clickTrackingParams":"CKkBENzXBBgHIhMI2K78-86p9gIV-JTYBR0 Europe and milking Ukrainians for dirt on the Bidens, he was probably milking cows on his familys dairy farm.\n\nThis is the story of Devin Nunes a congressman who went from suing a cow parody Twitter account to being center stage in one former steak salesman's impeachment process.\n\nDevin Gerald Nunes was born in 1973 in Tulare, California. His family is of Portugese descent, they emigrated from Azores to the U.S., which is possibly why Nunes once had a lax view on immigration. Nunes once supported moderate immigration reform such as giving amnesty to undocumented people living and working in the U.S.. \n\nBut as Trump has increased resources for Immigration and Customs Enforcement and instituted a family separation policy at the border, Nunes has stood by the recipient of Home Alone 2 residual checks.\n\nBefore Nunes backed Trumps every move, he was working on his familys 640-acre dairy farm, looking like this. Nunes grew up on the California dairy farm, seemingly milking cows and raising cattle. But along the way, he also raised some eyebrows.\n\nA deeply sourced Esquire report notes that the farm secretly moved to Sibley, Iowa more than a decade ago. Nunes hasnt acknowledged the move and the piece alleges that the farm heavily relies on cheap undocumented immigrant labor.\n\n Its worth noting that in 2010, Nunes campaigned for racist Iowa Congressman Steve King, who called illegal immigration a slow-motion terrorist attack. Nunes might want to stop campaigning for guys that want to rid the country of the very people his familys farm ostensibly relies on to stay afloat. Nunes has since sued Ryan Lizza, the author of the Esquire piece, and the publisher, for $75 million in damages.\n\n"},{"text":"#WhoIs","navigationEndpoint":{"clickTrackingParams":"CB8Q3NcEGAYiEwjYrvz7zqn2AhX4lNgFHTJpDd0=","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/whois","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId"
